async fn get_audio_url(api_key: &str, api_secret: &str, text: &str) -> String {
    let client = Client::new();
    let res = client
        .post("https://api.elevenlabs.io/v1/text-to-speech")
        .header("Authorization", format!("Bearer {}", api_key))
        .header("Content-Type", "application/json")
        .body(json!({
            "text": text,
            "voice": "EnglishUS",
            "format": "mp3",
        }))
        .send()
        .await
        .unwrap();

    let audio_url = res.json::<AudioUrl>().await.unwrap().url;

    audio_url
}

async fn download_audio_file(url: &str) -> String {
    let client = Client::new();
    let res = client.get(url).send().await.unwrap();

    let audio_file = res.bytes().await.unwrap();

    // Save the audio file to a temporary file
    let temp_file = tempfile::tempfile().unwrap();
    temp_file.write_all(&audio_file).unwrap();

    temp_file.path().to_str().unwrap().to_string()
}

struct AudioUrl {
    url: String,
}
