Here are a few popular compiler optimization techniques:

1.  **Dead Code Elimination (DCE)**: This technique removes code that is never executed. It's useful for reducing the size of the binary and improving performance.

    Example code:

    ```c
    int x = 5;
    if (x > 10) {
        printf("x is greater than 10\n");
    }
    ```

    Optimized code:

    ```c
    // The compiler will eliminate the printf statement because x is never greater than 10.
    int x = 5;
    if (x > 10) {
        // empty statement
    }
    ```

2.  **Constant Folding**: This technique evaluates constant expressions at compile-time, eliminating the need for runtime evaluation.

    Example code:

    ```c
    int x = 5 + 3;
    ```

    Optimized code:

    ```c
    int x = 8;
    ```

3.  **Common Subexpression Elimination (CSE)**: This technique eliminates duplicate expressions by storing the result in a temporary variable.

    Example code:

    ```c
    int x = 5;
    int y = x + 3;
    int z = x + 3;
    ```

    Optimized code:

    ```c
    int x = 5;
    int y = x + 3;
    int z = y;
    ```

4.  **Loop Unrolling**: This technique unrolls loops to reduce the number of iterations and improve performance.

    Example code:

    ```c
    for (int i = 0; i < 10; i++) {
        printf("%d\n", i);
    }
    ```

    Optimized code:

    ```c
    for (int i = 0; i < 10; i += 2) {
        printf("%d\n", i);
        printf("%d\n", i + 1);
