using System;
using System.Net.Http;
using System.Text;
using System.Threading.Tasks;
using Newtonsoft.Json;

public class SteamUser
{
    public string SteamId { get; set; }
    public int VACBans { get; set; }
    public DateTime LastVACBan { get; set; }
}

public class Program
{
    public static async Task Main(string[] args)
    {
        string steam64Id = "STEAM_0:0:123456789"; // Replace with the Steam64ID of the user
        string apiKey = "YOUR_API_KEY"; // Replace with your Steam API key

        string url = $"http://api.steampowered.com/ISteamUser/GetPlayerSummaries/v0002/?key={apiKey}&steamids={steam64Id}";

        using (var client = new HttpClient())
        {
            var response = await client.GetAsync(url);

            if (response.IsSuccessStatusCode)
            {
                var responseBody = await response.Content.ReadAsStringAsync();
                var steamUser = JsonConvert.DeserializeObject<SteamUser>(responseBody);

                Console.WriteLine($"Steam64ID: {steamUser.SteamId}");
                Console.WriteLine($"VAC Bans: {steamUser.VACBans}");
                Console.WriteLine($"Last VAC Ban: {steamUser.LastVACBan}");
            }
            else
            {
                Console.WriteLine($"Failed to retrieve data. Status code: {response.StatusCode}");
            }
        }
    }
}
```

This program uses the `HttpClient` class to send a GET request to the Steam API with the user's Steam64ID and your Steam API key. The response is then deserialized into a `SteamUser` object, which contains the user's Steam64ID, VAC bans, and last VAC ban date. The program then prints out these values to the console.
